  [],\n\t\"revision_timestamp\": \"2016-10-20T17:54:07.195671\",\n\t\"name\": \"malheur-national-wildlife-refuge-narrative-report-1957-3-september-december\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Malheur NWR outlines
  Refuge accomplishments from September through December of 1957. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, vegetation control, and wildfires.
  Resource management is outlined; topics include grazing, haying, and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, violations, and safety. Items of interest, N-R forms,
  and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
